import React from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

import { AddRecipeView, Nav, RecipeOverview, RecipesView, ScrollToTop } from "../config/C4";

const AppRouter = () => {
  return (
    <Router>
      <div className="container">
        <Nav />
        <ScrollToTop />
        <Switch>
          <Route path="/" exact component={RecipeOverview} />
          <Route path="/recepten" exact component={RecipesView} />
          <Route path="/recept-toevoegen" exact component={AddRecipeView} />
          <Route path="/recept/:id" exact component={RecipeOverview} />
        </Switch>
      </div>
    </Router>
  );
};

export default AppRouter;
